import userService from "./Appservices/App.service";



function App() {

  const onSubmit = (data) => {
    async function fetchResults() {
      try {
        const response = await userService.login(data.uid, data.password);

        if (response.data) {
          localStorage.setItem("user", JSON.stringify(response.data));
          localStorage.setItem("token", JSON.stringify(response.data.token));


        }
      } catch (e) {

        console.log(e);
      }
    }
    fetchResults();
  };

  console.log("er inde");
  return null;
}

export default App;
